const Container = styled.div`
  position: fixed;
  width: 100vh;
  height: 40vh;
  background: black;
  top: 30%;
  left: 25%;
`;
const Card = styled.div`
  position: absolute;
  top: 50%;
  left: 50%;
  margin: -25px 0 0 -25px;
  color: white;
`;
const FieldWrapper = styled.div``;
const Type = styled.span``;
const Number = styled.span``;
const Expiration = styled.span``;
const Owner = styled.span``;

const CCMaker = () => {
  return (
    <Container>
      <Card>
        <FieldWrapper>
          <Number>376916524164335</Number>
        </FieldWrapper>
        <FieldWrapper>
          <Expiration>10/20</Expiration>
        </FieldWrapper>
        <FieldWrapper>
          <Owner>Kiel Lemke</Owner>
        </FieldWrapper>
        <FieldWrapper>
          <Type>Visa</Type>
        </FieldWrapper>
      </Card>
    </Container>
  );
};

export default CCMaker;
